const PaperDetails = ({ paper }) => {
    return (
        <div className="paper-details">
            <h4>{paper.title}</h4>
            <p><strong>Load (kg): </strong>paper.load</p>
            <p><strong>Reps: </strong>{paper.reps}</p>
            <p>{paper.createdAt}</p>
        </div>
    )
}

export default PaperDetails
